INSERT INTO `recipe` VALUES (1,'2023-04-05 02:13:35','2023-04-05 02:13:35','홈런볼 맛있게 먹는 방법 알려드리겠습니다.\n에어프라이에 180도로 5분 돌려 먹으세요.\n맛있음!!!','홈런볼 맛있게 먹는법!',10),(2,'2023-04-06 23:16:57','2023-04-06 23:16:57','과자랑 아이스크림이랑 같이 먹으면 맛있어요 ! \n다들 집에 있다면 한번쯤 조합해서 먹어볼 맛 히히 ','과자랑 아이스크림이랑 같이 먹으면 JMTGR ;>',16),(3,'2023-04-06 23:21:30','2023-04-06 23:21:30','홈런볼 맛있게 먹는 방법 공유드립니당~\n에어프라이어 180도에 3분 돌리면 겉은 바삭하고 초콜릿을 살짝 녹아서 진짜 맛있어요.\n다들 먹어보세요~~~','홈런볼 맛있게 먹기',15),(4,'2023-04-06 23:21:50','2023-04-06 23:21:50','누텔라에 참깨스틱하면 고소+달콤입니다... ♥','이건 못참치',12),(5,'2023-04-06 23:21:56','2023-04-06 23:21:56','곱게 간 얼음 위에 칸초와 빼빼로를 얹어서 먹으니 맛있었어요!\n더운 여름에 한 번 해먹어봐요','칸초 빼빼로 수제 빙수',11),(6,'2023-04-06 23:24:22','2023-04-06 23:24:22','흔히들 에어프라이어에 돌려먹으면 맛있다고 아시는데,\n얼려먹어도 맛있습니다.\n요즘말로 JMT라고 하죠?\n여름엔 시원하게 얼려드세요 ㅎㅎㅎㅎ','꼬북칩 얼려먹어 보세요!!',12),(7,'2023-04-06 23:24:32','2023-04-06 23:24:32','바나나킥 꿀맛태잉요.\n에어프라이어가 갓...\n160도 5분, 180도 3분.\n취향에 따라 먹어보세요~~','바나나킥 꿀맛탱',15),(8,'2023-04-06 23:25:45','2023-04-06 23:25:45','날도 슬슬 더워지는데 엑설런트랑 같이드셔보세요 :)','쿠크런트 아시나요',12),(9,'2023-04-06 23:26:03','2023-04-06 23:26:03','준비물 : 감자칩, 케찹, 매운소스(핫소스나 스리라차가능)\n\n1. 케찹과 매운소스를 1:1 비율로 섞는다.\n2. 준비한 감자칩을 만든 소스에 찍어 먹는다\n\n아주 간편한데 맛있는 소스 완성 !','감자칩 최강 조합 !?!',16),(10,'2023-04-06 23:28:05','2023-04-06 23:28:05','다이제와 투게더를 같이먹으면 동맥경화 솔솔오겠죠??\n\n TIP) 다이제의 초코면을 안으로 해야 잡기 편함!!','다.이.투.게.더',12),(11,'2023-04-06 23:29:20','2023-04-06 23:29:20','칸빠레 오또상!\n여름엔 뭐든 아이스크림을 섞어줘야 좋더라구요','칸쵸+빵빠레 = 칸빠레',12),(12,'2023-04-06 23:29:36','2023-04-06 23:29:36','크래커에 땅콩버터는 생각도 못해봤쥐 ~ ,,\n맛있겠지 ~ ? 못잡겠쥐 ~?\n유 원트 잇 ~?? ','[개봉박두] 크래커앤 땡콩붜터 ~',16),(13,'2023-04-06 23:30:14','2023-04-06 23:30:14','건빵만 먹으면 목 메이니깐 우유에다가 먹는거 추천!\n좀 더 신선한 맛을 원한다면 초코 과자도 넣어서 먹으면 더 맛있어요!','건빵에 우유 조합 추천!',11),(14,'2023-04-06 23:30:58','2023-04-06 23:30:58','제크 > 초코스프레드> 바나나 > 까망칸쵸 바닐라 순으로\n차곡차곡 올려주면 초간단 칸쵸카나페 완성','칸쵸카나페 어때요',12),(15,'2023-04-06 23:32:20','2023-04-06 23:32:20','에어프라이어 180도에 3분 돌려먹으니 동맥경화 솔솔 옵니다!','칸쵸.. 데워드셔요',12);
